-- Name: add_prono(uuid, integer, integer, integer, boolean); Type: FUNCTION; Schema: public; Owner: supabase_admin
--

CREATE FUNCTION public.add_prono(user_id_input uuid, partido_input integer, pron_loc_input integer, pron_vis_input integer, comodin_input boolean) RETURNS SETOF public.pronos
    LANGUAGE plpgsql
    AS $$
  declare
  p_id int;
begin
  select id
  into p_id
  from fixture
  where fixture.id = partido_input;

  values ( user_id_input, p_id, pron_loc_input, pron_vis_input, comodin_input )

  ON CONFLICT (user_id, partido)
  DO UPDATE SET
	pron_loc = pron_loc_input , pron_vis = pron_vis_input;

  return query select * from pronos where user_id = user_id_input;

end;

$$;


