--
-- Name: usuariospolla _RETURN; Type: RULE; Schema: public; Owner: supabase_admin
--

CREATE OR REPLACE VIEW public.usuariospolla AS
 SELECT usuarios.alias,
    usuarios.id,
    usuarios.favorito,
    usuarios.hincha,
    usuarios."isPagado",
    usuarios."isPollero",
    count(pronos.id) AS pronos
   FROM (public.usuarios
     LEFT JOIN public.pronos ON (((usuarios.id = pronos.user_id) AND (pronos.partido <= 48))))
  GROUP BY usuarios.id;


